d-7915-4f0a-9e29-ba7dcdf3bf8d.jpg?alt=media','<p>âsasasas</p>',NULL,'sản phẩm mới',100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac'),(12,_binary '','2024-09-28 19:56:18.387000','2024-09-28 19:56:18.387000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/8db35f21-41cd-41ff-baa3-770815822737.png?alt=media','<p>Gạo và Nước Thiên An chuyên phân phối các sản phẩm gạo ngon đáp ứng mọi nhu cầu trên thị trường như gạo từ thiện, gạo ngon chuyên cung cấp cho nhà hàng, quán ăn, các bếp ăn công nghiệp tại khu vực thành phố Hồ Chí Minh và thành phố Thủ Đức, các sản phẩm gạo tại Thiên An không chỉ đáp ứng nhu cầu trong tiêu dùng của khách hàng mà còn đáp ứng tiêu chuẩn về chất lượng, đảm bảo nguồn gốc rõ ràng. Bên cạnh yếu tố về chất lượng, Gạo và Nước Thiên An còn hỗ trợ giao hàng tận nơi hoàn toàn miễn phí, tạo sự tiện lợi, hỗ trợ tư vấn khách hàng lựa chọn sản phẩm Gạo phù hợp nhất đến với từng nhu cầu của quý khách.</p>','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/8e6a5df1-8e2c-4ab1-b4f2-e66e77c5dea2.png?alt=media','<p>Gạo và Nước Thiên An chuyên phân phối sỉ và lẻ các sản phẩm gạo đặc sản, gạo thơm, gạo hữu cơ cao cấp khu vực thành phố Thủ Đức, thành phố Hồ Chí Minh, với phương châm mang quý khách hàng những sản phẩm chất lượng cao với mức giá bình ổn, các sản phẩm Gạo tại Thiên An được nhập trực tiếp từ những vùng nguyên liệu chuyên canh tác các giống gạo đặc sản ở khu vực Đồng Bằng Sông Cửu Long như Sóc Trăng, Tiền Giang,…</p>',NULL,'Gạo Tấm',100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac'),(13,_binary '','2024-09-28 19:58:33.438000','2024-09-28 19:58:33.438000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/b59aebe1-5d6d-4be6-9e51-d02c590d7a38.png?alt=media','<p>sdfsdfsdfsdf</p>','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/67018e15-7fa0-4948-a809-5ad59b12a9aa.png?alt=media','<p>âsassadsdsd</p>',NULL,'Gạo Nếp',100,'cfb70096-68ab-49cd-b389-0