INSERT INTO `tbl_categories_post` VALUES (1,_binary '','2024-10-08 00:00:00.000000','2024-10-21 08:52:49.607000','http://localhost:8080/quan-tri/them-san-pham','sản phẩm mới hehe',100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/45174db4-0026-450c-a5b9-cb976e69e8f5.jpg?alt=media','<div class=\"v-col v-col-12 ck-content\" style=\"-webkit-text-stroke-width:0px;background-repeat:no-repeat;box-sizing:inherit;color:rgb(0, 0, 0);flex:0 0 100%;font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0px;max-width:100%;orphans:2;padding:12px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;width:1272px;word-spacing:0px;\"><h2 style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;text-align:center;\">&nbsp;</h2><h2 style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;text-align:center;\"><span style=\"color:rgb(0,0,0);\"><span style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">Công ty TNHH Thương Mại Tổng Hợp Thiên An - Gạo và Nước Thiên An</span></span></h2><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;text-align:center;\"><span style=\"color:rgb(0,0,0);font-size:17px;\"><span style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">“Nước sạch thiên nhiên - Gạo ngon từ tâm - Nâng tầm khẩu vị”</span></span></p><figure class=\"image image_resized\"><img style=\"aspect-ratio:1500/600;\" src=\"data:image/jpeg;base64,\" width=\"1500\" height=\"600\" uploadprocessed=\"true\"></figure><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo và Nước Thiên An</strong> - Nhà phân phối các sản phẩm gạo,gạo tấm, nếp được nhập trực tiếp từ những vùng nguyên liệu chuyên canh tác các giống gạo đặc sản trên thị trường hiện nay tại khu vực Tây Nam Bộ (Đồng Bằng Sông Cữu Long). Chúng tôi chuyên cung cấp các sản phẩm gạo đặc sản , gạo sạch nhằm đáp ứng nhu cầu trên thị trường từ hộ gia đình cho đến nhà hàng, quán ăn, bếp ăn công nghiệp, gạo từ thiện tại<strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\"> khu vực thành phố Thủ Đức và thành phố Hồ Chí Minh.</strong></p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">&nbsp;</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">Ngoài ra, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo và Nước Thiên An</strong> là Nhà phân phối sỉ và lẻ các sản phẩm nước tinh khiết, nước khoáng cao cấp của các thương hiệu uy tín trên thị trường như <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Vihawa (Vĩnh Hảo)</strong>, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Lavie</strong>,<strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\"> Ion Life</strong>, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Satori</strong>, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Bidrico</strong>, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Asona</strong>. Với phương châm “Nói không với sản phẩm kém chất lượng”, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo và Nước Thiên An</strong> cam kết các sản phẩm nước được nhập trực tiếp từ nhà máy sản xuất, đảm bảo chất lượng trong từng sản phẩm khi trao đến tay người tiêu dùng, tạo sự kết nối giữa người tiêu dùng từ hộ gia đình, văn phòng, công ty đến các doanh nghiệp hàng đầu chuyên sản xuất nước uống cao cấp tại <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">khu vực thành phố Thủ Đức, thành phố Hồ Chí Minh.</strong></p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">&nbsp;</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">Bên cạnh yếu tố chất lượng sản phẩm, <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo và Nước Thiên An </strong>còn không ngừng nâng cao chất lượng dịch vụ, từ dịch vụ khách hàng cho đến dịch vụ giao hàng, cập nhật liên tục các chương trình khuyến mãi của các Doanh nghiệp, tạo dựng niềm tin, xây dựng uy tín, tạo sự hài lòng trong mỗi khách hàng trong quá trình sử dụng dịch vụ tại <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo và Nước Thiên An</strong>.</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">&nbsp;</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><span style=\"font-size:17px;\"><span style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\"><u style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">Thông tin liên hệ</u></strong></span></span></p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Địa chỉ văn phòng</strong>: 50/59 Thạnh Xuân 25, phường Thạnh Xuân, quận 12, thành phố Hồ Chí Minh.</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Địa chỉ chi nhánh 1</strong>: 581 Nguyễn Xiển, Long Thạnh Mỹ, quận 9, thành phố Thủ Đức.</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Địa chỉ chi nhánh 2</strong>: Số 51, đường số 7, KDC Cityland, phường 7, quận Gò Vấp, TP.HCM</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Mã số thuế</strong>: 0316278185</p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Tổng đài đặt hàng</strong>: (<a style=\"background-color:transparent;background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;text-decoration:none;\" href=\"tel:02838030333\">028)38.030.333</a> - <a style=\"background-color:transparent;background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;text-decoration:none;\" href=\"tel:0981388777\">0981.388.777</a></p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">E-mail</strong>: <a style=\"background-color:transparent;background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;text-decoration:none;\" href=\"mailto:gaonuocthienan@gmail.com\">gaovanuocthienan@gmail.com</a></p><p style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\"><strong style=\"background-r