INSERT INTO `tbl_post` VALUES (1,_binary '\0','2024-10-08 00:00:00.000000','2024-10-21 12:02:41.688000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/9e27526d-e4e1-4ec8-966f-bfff7cdcf31d.jpg?alt=media','<h2 style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);\">Công ty TNHH Thương Mại Tổng Hợp Thiên An - Gạo và Nước Thiên An</span></h2><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);font-size:17px;\">“Nước sạch thiên nhiên - Gạo ngon từ tâm - Nâng tầm khẩu vị”</span></p><p style=\"margin-left:0px;\"><strong>Gạo và Nước Thiên An</strong> - Nhà phân phối các sản phẩm gạo,gạo tấm, nếp được nhập trực tiếp từ những vùng nguyên liệu chuyên canh tác các giống gạo đặc sản trên thị trường hiện nay tại khu vực Tây Nam Bộ (Đồng Bằng Sông Cữu Long). Chúng tôi chuyên cung cấp các sản phẩm gạo đặc sản , gạo sạch nhằm đáp ứng nhu cầu trên thị trường từ hộ gia đình cho đến nhà hàng, quán ăn, bếp ăn công nghiệp, gạo từ thiện tại<strong> khu vực thành phố Thủ Đức và thành phố Hồ Chí Minh.</strong></p><p style=\"margin-left:0px;\"><span style=\"font-size:17px;\"><strong><u>Thông tin liên hệ</u></strong></span></p><p style=\"margin-left:0px;\"><strong>Địa chỉ văn phòng</strong>: 50/59 Thạnh Xuân 25, phường Thạnh Xuân, quận 12, thành phố Hồ Chí Minh.</p><p style=\"margin-left:0px;\"><strong>Địa chỉ chi nhánh 1</strong>: 581 Nguyễn Xiển, Long Thạnh Mỹ, quận 9, thành phố Thủ Đức.</p><p style=\"margin-left:0px;\"><strong>Địa chỉ chi nhánh 2</strong>: Số 51, đường số 7, KDC Cityland, phường 7, quận Gò Vấp, TP.HCM</p><p style=\"margin-left:0px;\"><strong>Mã số thuế</strong>: 0316278185</p><p style=\"margin-left:0px;\"><strong>Tổng đài đặt hàng</strong>: (<a href=\"tel:02838030333\">028)38.030.333</a> - <a href=\"tel:0981388777\">0981.388.777</a></p><p style=\"margin-left:0px;\"><strong>E-mail</strong>: <a href=\"mailto:gaonuocthienan@gmail.com\">gaovanuocthienan@gmail.com</a></p><p style=\"margin-left:0px;\"><strong>Fanpage Facebook</strong>: <a href=\"https://www.facebook.com/nuocgaothienan\">https://www.facebook.com/nuocgaothienan</a></p><p style=\"margin-left:0px;\"><strong>Zalo</strong>: <a href=\"https://zalo.me/0981388777\">0981388777</a></p>',NULL,'<p>Nhà phân phối các sản phẩm gạo,gạo tấm, nếp được nhập trực tiếp từ những vùng nguyên liệu chuyên canh….</p>','http://localhost:8080/quan-tri/them-san-pham','Thời báo thiên an @',100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1),(2,_binary '','2024-10-08 00:00:00.000000','2024-10-17 12:58:03.641000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/0e1d6719-2be2-4766-8462-48c02c62e5e8.png?alt=media','<h2 style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);\">Công ty TNHH Thương Mại Tổng Hợp Thiên An - Gạo và Nước Thiên An</span></h2><p style=\"text-align:center;\"><span style=\"color:hsl(0,0%,0%);font-size:17px;\">“Nước sạch thiên nhiên - Gạo ngon từ tâm - Nâng tầm khẩu vị”</span></p><figure class=\"image\"><img style=\"aspect-ratio:2047/1365;\" src=\"data:image/webp;base64,\" width=\"2047\" height=\"1365\"></figure><p style=\"margin-left:0px;\"><strong>Gạo và Nước Thiên An</strong> - Nhà phân phối các sản phẩm gạo,gạo tấm, nếp được nhập trực tiếp từ những vùng nguyên liệu chuyên canh tác các giống gạo đặc sản trên thị trường hiện nay tại khu vực Tây Nam Bộ (Đồng Bằng Sông Cữu Long). Chúng tôi chuyên cung cấp các sản phẩm gạo đặc sản , gạo sạch nhằm đáp ứng nhu cầu trên thị trường từ hộ gia đình cho đến nhà hàng, quán ăn, bếp ăn công nghiệp, gạo từ thiện tại<strong> khu vực thành phố Thủ Đức và thành phố Hồ Chí Minh.</strong></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">Ngoài ra, <strong>Gạo và Nước Thiên An</strong> là Nhà phân phối sỉ và lẻ các sản phẩm nước tinh khiết, nước khoáng cao cấp của các thương hiệu uy tín trên thị trường như <strong>Vihawa (Vĩnh Hảo)</strong>, <strong>Lavie</strong>,<strong> Ion Life</strong>, <strong>Satori</strong>, <strong>Bidrico</strong>, <strong>Asona</strong>. Với phương châm “Nói không với sản phẩm kém chất lượng”, <strong>Gạo và Nước Thiên An</strong> cam kết các sản phẩm nước được nhập trực tiếp từ nhà máy sản xuất, đảm bảo chất lượng trong từng sản phẩm khi trao đến tay người tiêu dùng, tạo sự kết nối giữa người tiêu dùng từ hộ gia đình, văn phòng, công ty đến các doanh nghiệp hàng đầu chuyên sản xuất nước uống cao cấp tại <strong>khu vực thành phố Thủ Đức, thành phố Hồ Chí Minh.</strong></p><p style=\"margin-left:0px;\">&nbsp;</p><p style=\"margin-left:0px;\">Bên cạnh yếu tố chất lượng sản phẩm, <strong>Gạo và Nước Thiên An </strong>còn không ngừng nâng cao chất lượng dịch vụ, từ dịch vụ khách hàng cho đến dịch vụ giao hàng, cập nhật liên tục các chương trình khuyến mãi của các Doanh nghiệp, tạo dựng niềm tin, xây dựng uy tín, tạo sự hài lòng trong mỗi khách hàng trong quá trình sử dụng dịch vụ tại <strong>Gạo và Nước Thiên An</strong>.</p><figure class=\"image image-style-align-center image_resized\" style=\"width:70.02%;\"><img src=\"/storage/uploads/28-08-2023/31693192557.jpg\" srcset=\"/storage/uploads/28-08-2023/31693192559.webp 4000w\" sizes=\"100vw\" width=\"4000\"></figure><p style=\"margin-left:0px;\"><span style=\"font-size:17px;\"><strong><u>Thông tin liên hệ</u></strong></span></p><p style=\"margin-left:0px;\"><strong>Địa chỉ văn phòng</strong>: 50/59 Thạnh Xuân 25, phường Thạnh Xuân, quận 12, thành phố Hồ Chí Minh.</p><p style=\"margin-left:0px;\"><strong>Địa chỉ chi nhánh 1</strong>: 581 Nguyễn Xiển, Long Thạnh Mỹ, quận 9, thành phố Thủ Đức.</p><p style=\"margin-left:0px;\"><strong>Địa chỉ chi nhánh 2</strong>: Số 51, đường số 7, KDC Cityland, phường 7, quận Gò Vấp, TP.HCM</p><p style=\"margin-left:0px;\"><strong>Mã số thuế</strong>: 0316278185</p><p style=\"margin-left:0px;\"><strong>Tổng đài đặt hàng</strong>: (<a href=\"tel:02838030333\">028)38.030.333</a> - <a href=\"tel:0981388777\">0981.388.777</a></p><p style=\"margin-left:0px;\"><strong>E-mail</strong>: <a href=\"mailto:gaonuocthienan@gmail.com\">gaovanuocthienan@gmail.com</a></p><p style=\"margin-left:0px;\"><strong>Fanpage Facebook</strong>: <a href=\"https://www.facebook.com/nuocgaothienan\">https://www.facebook.com/nuocgaothienan</a></p><p style=\"margin-left:0px;\"><strong>Zalo</strong>: <a href=\"https://zalo.me/0981388777\">0981388777</a></p>',NULL,'<p>Nội dung ngắn gọn về bài viết A không vượt quá 300 ký tự. Nội dung ngắn gọn về bài viết A không vượt quá 300 ký tự…</p>','http://localhost:8080/quan-tri/them-san-pham','Bài viết 2 - Gạo và nước Thiên An',100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1),(3,_binary '\0','2024-10-21 11:07:04.538000','2024-10-21 11:16:50.645000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/d7ec4ae7-3e55-4661-acd8-1481c4c71c59.jpg?alt=media','<p>ádddddddddddd</p>',NULL,'<p>ádddddddddddddd</p>','http://localhost:8080/quan-tri/them-san-pham','ádddddddddđ',100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1);
