INSERT INTO `tbl_product` VALUES ('004bec1b-70bf-4481-9e8d-6c61b0e3d462',_binary '\0','2024-09-30 00:00:00.000000','2024-10-16 02:21:19.642000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/24e45981-fbfa-44e6-afa1-6f5e9a12c65c.png?alt=media','<p>aaaaaa</p>',23000,'<p>aaaaa</p>','http://localhost:8080/quan-tri/them-san-pham','helle',20000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,1,5,2,_binary '',NULL,''),('04334467-d1dd-404f-b4b2-4c4c6ab4a9e6',_binary '','2024-09-19 00:00:00.000000','2024-10-13 23:39:40.098000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Mỗi giọt nước Lavie đều được kiểm tra nghiêm ngặt, đảm bảo độ tinh khiết và an toàn tuyệt đối cho sức khỏe người dùng.\r\n',25000,'Nước Lavie 20L được lấy từ nguồn khoáng tự nhiên, qua quá trình lọc và đóng bình bằng công nghệ hiện đại, đảm bảo giữ nguyên các khoáng chất có lợi cho cơ thể. Lavie Water tự hào mang đến sản phẩm nước bình 20L có chất lượng vượt trội, giúp cơ thể bạn luôn cân bằng và khỏe mạnh.\r\n','','Nước uống Tinh Khiết Bidrico (19 lít) có vòi',20000,100,NULL,1,2,4,3,_binary '',1,''),('129e8900-92ce-4e17-aa8b-04a0492267f3',_binary '','2024-10-21 00:00:00.000000','2024-10-21 08:41:31.075000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/613c8475-d4ff-4c55-8a1f-320ef12df5ff.jpg?alt=media','<p>hfgfgh</p>',45345,'<p>56456646fg</p>','dfgg','dfgdfgdfg',4535,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,1,43534,0,_binary '',2,'https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/13b1bec0-dbb6-4e56-bf9d-c44d8409d30a.png?alt=media,https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/ee6c6f1e-2963-4da5-9da3-a1784f0259c1.png?alt=media,https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/398dced2-f732-4285-ac7a-e88fdfd55a4c.png?alt=media'),('3c5c9a1e-adbc-414f-91eb-8e100f211c0e',_binary '','2024-09-19 00:00:00.000000','2024-10-21 08:45:08.911000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Nước đóng bình 20L cũng là giải pháp tiết kiệm, kinh tế và thân thiện với môi trường.\r\n\r\n',23000,'Nên dùng trong vòng 2 tuần kể từ ngày mở niêm phong vòi hoặc nắp để đảm bảo sản phẩm luôn ở trạng thái chất lượng tốt nhất. Đặt bình nước Satori 20L nơi khô ráo, thoáng mát, sạch sẽ. Tránh ánh sáng trực tiếp, mùi mạnh hoặc các loại hoá chất.','','Nước uống Tinh Khiết Vĩnh hảo (19 lít) có vòi',20000,100,NULL,1,6,-1,1,_binary '',2,''),('3d763a02-e7ca-4819-8546-7bb7bb0a2442',_binary '','2024-09-19 00:00:00.000000','2024-10-13 23:39:18.870000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Giữa thị trường nước uống đóng chai khá phong phú tại Việt Nam, nước khoáng thiên nhiên La Vie luôn nổi bật bởi sự khác biệt về vị thanh mát do hàm lượng khoáng chất vừa phải mang lại',23000,'Với dịch vụ giao nước tận nơi miễn phí, Lavie Water cam kết mang đến cho khách hàng sự hài lòng tuyệt đối. Bạn chỉ cần đặt hàng và ngồi chờ, nước Lavie 20L sẽ được giao đến tận nhà trong thời gian ngắn nhất, đảm bảo tiện lợi và nhanh chóng.','','Nước uống Tinh Khiết lavie (19 lít) có vòi',20000,100,NULL,1,1,2,1,_binary '',1,''),('3fd3a36a-02bb-4996-862d-79d8d7ecb8d4',_binary '','2024-09-30 00:00:00.000000','2024-10-21 08:45:08.981000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/d69c65df-7d39-474f-a526-b2e4325345d4.png?alt=media','<p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Thông tin sản phẩm:</strong></p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo Hương Lài Sữa</strong> có hình dáng dài hạt, hạt gạo trắng trong khi nấu gạo có mùi hương lài dịu nhẹ, hạt cơm dẽo mềm, tăng thêm hương vị cho bữa ăn gia đình. Sản phẩm <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">gạo Hương Lài Sữa</strong> phù hợp đối với hầu hết đối tượng khách hàng, bếp ăn công nghiệp, nhà hàng quán cơm cao cấp, đặc biệt phù hợp đối với đối tượng khách hàng thích dùng gạo dẽo. <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo Hương Lài Sữa</strong> là một trong những dòng sản phẩm được ưa chuộng nhất trên thị trường hiện nay, có mặt trong hầu hết các bữa ăn gia đình Việt Nam.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Sản phẩm <strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Gạo Hương Lài Sữa</strong> được nhập trực tiếp từ các vùng nguyên liệu tại khu vực miền Tây Nam Bộ - một trong những khu vực có truyền thống lâu đời chuyên trồng cây lúa nước tại Việt Nam.&nbsp;</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Hướng dẫn sử dụng</strong>:</p><ul style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;list-style-type:disc;margin-bottom:0px;margin-right:0px;margin-top:0px;orphans:2;padding:0px 0px 0px 12px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Bước 1: Đong gạo theo nhu cầu.</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Bước 2: Vo gạo bằng nước sạch (từ 1-2 lần).</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Bước 3: Chắt nước thật ráo.</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Bước 4: Thêm nước theo tỉ lệ: 1kg gạo : 1,2 lít nước.</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Bước 5: Đậy nắp nồi trong suốt quá trình nấu.</p></li></ul><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Lưu ý: khi cơm đã được nấu tầm 30 phút, mở nắp nồi cơm và xới đều nồi cơm, để gạo nghỉ thêm từ 5-10 phút.&nbsp;</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Ngoài ra, quý khách có thể thêm một ít lá dứa vào trong quá trình nấu để tăng thêm hương vị cho bữa ăn gia đình.</p><p style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Qui trình bảo quản</strong>:</p><ul style=\"-webkit-text-stroke-width:0px;background-color:rgb(255, 255, 255);background-repeat:no-repeat;box-sizing:inherit;color:rgba(0, 0, 0, 0.87);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:14px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:0.25px;list-style-type:disc;margin-bottom:0px;margin-right:0px;margin-top:0px;orphans:2;padding:0px 0px 0px 12px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Lưu trữ và bảo quản ở nơi khô ráo và thoáng mát.</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Sản phẩm nên bảo quản vào thùng nhựa, chum vại, đậy kín nắp, tránh tiếp xúc trực tiếp với môi trường bên ngoài, tránh côn trùng và mùi lạ.</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Sản phẩm không phù hợp bảo quản tại khu vực có độ ẩm cao.</p></li></ul>',20000,'<p style=\"-webkit-text-stroke-width:0px;background-repeat:no-repeat;box-sizing:inherit;color:rgb(0, 0, 0);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0px;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><strong style=\"background-repeat:no-repeat;box-sizing:inherit;font-weight:bolder;margin:0px;padding:0px;\">Thông tin</strong></p><ul style=\"-webkit-text-stroke-width:0px;background-repeat:no-repeat;box-sizing:inherit;color:rgb(0, 0, 0);font-family:&quot;Be Vietnam Pro&quot;, sans-serif;font-size:16px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;list-style-type:disc;margin-bottom:0px;margin-right:0px;margin-top:0px;orphans:2;padding:0px 0px 0px 12px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Thành phần: Nước tinh khiết cao cấp</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Dung tích: Bình 19 lít</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Loại bình: Bình có vòi (Val)</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Thương hiệu: Asona</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Sản xuất bởi: <span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);\"><span style=\"background-repeat:no-repeat;box-sizing:inherit;margin:0px;padding:0px;\">Công Ty TNHH MTV TM Sản Xuất Thái Hòa Water.</span></span></p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Xuất xứ: Việt Nam</p></li><li style=\"background-repeat:no-repeat;box-sizing:inherit;margin-bottom:0px;margin-right:0px;margin-top:0px;padding:0px;\"><p style=\"margin-left:0px;\">Cọc vỏ bình: 50.000 đồng/cái</p></li></ul>','http://localhost:8080/quan-tri/them-san-pham','Nam',28000,100,NULL,1,2,6,1,_binary '',1,''),('3fe36901-e61d-4327-9c56-2bf9b56288ca',_binary '','2024-10-01 00:00:00.000000','2024-10-16 11:28:15.757000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/c934b301-b704-41b0-a574-29790d29e30c.jpg?alt=media','<figure class=\"item_slide_show clearfix\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;clear:both;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0px auto 20px;max-width:100%;orphans:2;padding:0px;position:relative;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizelegibility;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><div class=\"inner_caption\" style=\"box-sizing:border-box;margin:0px;padding:0px;text-rendering:optimizelegibility;\"><p class=\"Image\" style=\"box-sizing:border-box;font:400 14px / 22.4px arial;margin:0px;padding:10px 0px 0px;text-align:left;text-rendering:optimizespeed;\"><strong>Video quay tại thành phố Kiryat Shmona, miền bắc Israel, cho thấy ánh sáng lóe lên ở khu vực biên giới Lebanon đêm 30/9. Video: </strong><em style=\"box-sizing:border-box;margin:0px;padding:0px;text-rendering:optimizelegibility;\"><i><strong>X/Zachonearth</strong></i></em></p></div></figure><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Hezbollah rạng sáng nay tuyên bố đang nhắm mục tiêu vào các đơn vị IDF cơ động bên kia biên giới, nhưng không nêu chi tiết. Còi báo động rocket đã vang lên tại thị trấn Misgav Am ở khu vực biên giới phía bắc Israel cùng những nơi lân cận, chưa có thông tin về thiệt hại hay thương vong.</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Người dân ở thị trấn biên giới Aita al-Shaab, phía nam Lebanon, đã nghe thấy các đợt pháo kích dữ dội cùng tiếng trực thăng, máy bay không người lái (UAV) trên đầu.</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Truyền thông Lebanon cho biết Israel đã tập kích tòa nhà ở trại tị nạn Ain El-Hilweh gần thành phố Sidon, đánh dấu lần đầu khu vực này bị tấn công kể từ khi giao tranh bùng phát đầu tháng 10/2023.</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Người phát ngôn Bộ Ngoại giao Mỹ Matthew Miller cho hay Tel Aviv đã thông báo trước cho Washington về chiến dịch này.</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\"><em style=\"box-sizing:border-box;margin:0px;padding:0px;text-rendering:optimizelegibility;\"><i>Times of Israel </i></em>dẫn lời quan chức Mỹ giấu tên cho hay chính quyền Tổng thống Joe Biden \"hiểu và thông cảm\" với quyết định mở chiến dịch của Tel Aviv, nhưng lo ngại nguy cơ quân đội Israel sa lầy ở Lebanon hoặc sẽ mở rộng chiến dịch.</p><figure class=\"image\"><img style=\"aspect-ratio:960/660;\" src=\"data:image/webp;base64,\" width=\"960\" height=\"660\" uploadprocessed=\"true\"></figure><p>&nbsp;</p><figure class=\"tplCaption action_thumb_added\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;clear:both;color:rgb(34, 34, 34);float:left;font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;margin:0px auto 15px;max-width:100%;orphans:2;padding:0px;position:relative;text-align:center;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizelegibility;text-transform:none;white-space:normal;widows:2;width:680px;word-spacing:0px;\" data-size=\"true\" itemprop=\"associatedMedia image\" itemscope=\"\" itemtype=\"http://schema.org/ImageObject\"><p class=\"Image\" style=\"box-sizing:border-box;color:rgb(34, 34, 34);font:400 14px / 22.4px arial;margin:0px;padding:10px 0px 0px;text-align:left;text-rendering:optimizespeed;\">Pháo tự hành Israel công kích mục tiêu ở Lebanon đêm 30/9. Ảnh: <em style=\"box-sizing:border-box;margin:0px;padding:0px;text-rendering:optimizelegibility;\"><i>AP</i></em></p></figure><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Một quan chức Israel cũng tiết lộ nội dung trao đổi giữa hai bên, trong đó Tel Aviv thông báo rằng chiến dịch nhằm xóa bỏ các cơ sở của Hezbollah dọc biên giới Lebanon - Israel, tạo điều kiện cho thỏa thuận ngoại giao, buộc Hezbollah lùi khỏi khu vực sông Litani, phù hợp với nghị quyết của Hội đồng Bảo an Liên Hợp Quốc.</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Một quan chức Lebanon nói rằng quân đội nước này \"tái bố trí các binh sĩ\" đến những khu vực ở xa biên giới.</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Các lãnh đạo thế giới trước đó liên tục thúc giục hạ nhiệt căng thẳng Israel - Hezbollah. Stephane Dujarric, phát ngôn viên của Tổng thư ký Liên Hợp Quốc Antonio Guterres, cho biết tổ chức này \"không muốn chứng kiến bất cứ cuộc tấn công trên bộ nào\".</p><p class=\"Normal\" style=\"-webkit-text-stroke-width:0px;background-color:rgb(252, 250, 246);box-sizing:border-box;color:rgb(34, 34, 34);font-family:arial;font-size:18px;font-style:normal;font-variant-caps:normal;font-variant-ligatures:normal;font-weight:400;letter-spacing:normal;line-height:28.8px;margin:0px 0px 1em;orphans:2;padding:0px;text-align:start;text-decoration-color:initial;text-decoration-style:initial;text-decoration-thickness:initial;text-indent:0px;text-rendering:optimizespeed;text-transform:none;white-space:normal;widows:2;word-spacing:0px;\">Tổng thống Mỹ Joe Biden ngày 30/9 cũng khẳng định phản đối chiến dịch trên bộ của Israel tại Lebanon. \"Hãy ngừng bắn ngay bây giờ\", ông nói.</p>',25000,'<p>asfasdasdas</p>','http://localhost:8080/quan-tri/them-san-pham','test',20000,100,NULL,1,2,9,1,_binary '',2,''),('6aaf69ea-63af-46ca-9954-caf0abce83b4',_binary '','2024-10-12 00:00:00.000000','2024-10-21 11:57:41.324000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/ae69e8fc-162a-4b31-bf4b-b18e73c98474.jpg?alt=media','<p>sdfsdfsf</p>',25000,'<p>sdfsdfsdfsdf</p>','http://localhost:8080/quan-tri/them-bai-viet','Gạo Nếp',22000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,10,9,0,_binary '',4,'https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/8c84666c-5f3b-4f7f-a0fa-fd2e92c146a9.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/c64f5b8d-a3e3-4e59-bc3c-e0a98c4e788d.jpg?alt=media,https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/5d008d12-eed8-4c4a-a299-094bf72b2a37.png?alt=media'),('76706ad7-cf81-46e2-9da4-f2b94f699da3',_binary '','2024-09-19 00:00:00.000000','2024-10-21 10:47:22.524000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Thiết kế bình tiện lợi, dễ dàng lắp đặt trên các loại máy lọc nước hoặc chân đế, giúp bạn tiết kiệm không gian và thuận tiện trong việc sử dụng.\r\n',26000,'Satori hiểu điều này và luôn nỗ lực mang đến sản phẩm tốt nhất cho người tiêu dùng. Nước Satori 20L không chỉ là một nguồn nước uống, mà còn là một sự đầu tư cho sức khỏe lâu dài của bạn và gia đình. Hãy để Satori 20L đồng hành cùng bạn trong hành trình bảo vệ sức khỏe, mang lại sự tươi mới và sức sống mỗi ngày.\r\n','','Nước uống Tinh Khiết Ion Life (19 lít) có vòi',20000,100,NULL,1,3,0,1,_binary '',2,''),('7bc7b1ed-9b5a-4b50-af2c-f608c93e5815',_binary '','2024-09-19 16:01:54.040000','2024-09-19 16:01:54.040000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Quy trình xử lý nước từ bước đầu tiên đã được kiểm soát chặt chẽ, bao gồm điều chỉnh pH, lọc thô, lọc cát, lọc sỏi, và qua nhiều lớp lọc tinh đến 0.2µm.\n\n',23000,'Quy trình xử lý vỏ bình cũng không kém phần nghiêm ngặt. Sau khi vỏ bình được kiểm tra và làm sạch, chúng sẽ trải qua quá trình súc rửa tự động gồm bốn bước, từ súc rửa bằng nước xử lý, NaOH, chất diệt khuẩn P3, đến rửa sạch lại bằng nước xử lý.\n\n',NULL,'Nước uống Tinh Khiết asona (19 lít) có vòi',20000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,5,0,0,NULL,NULL,''),('85eeeb68-2924-436d-99f2-a9504bd6a1d5',_binary '','2024-09-19 00:00:00.000000','2024-10-21 10:52:14.098000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Không dùng vỏ bình để chứa bất kỳ thứ gì sau khi sử dụng.',25000,'Nước Lavie 20L được lấy từ nguồn khoáng tự nhiên, qua quá trình lọc và đóng bình bằng công nghệ hiện đại, đảm bảo giữ nguyên các khoáng chất có lợi cho cơ thể. Lavie Water tự hào mang đến sản phẩm nước bình 20L có chất lượng vượt trội, giúp cơ thể bạn luôn cân bằng và khỏe mạnh.','','Nước uống Tinh Khiết aquafina (19 lít) có vòi',20000,100,NULL,1,7,-5,5,_binary '',2,''),('c536f7ac-8c08-4d3b-a3a5-0ac3f7d6fe62',_binary '','2024-10-12 00:00:00.000000','2024-10-16 11:36:48.164000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/8e1d52e6-dfa0-4ef9-97ae-5c2b6ceae81c.png?alt=media','<p>321312321</p>',25000,'<p>212121212</p>','http://localhost:8080/quan-tri/them-san-pham','Gạo Nếp',23000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,4,9,0,_binary '',3,''),('d29df687-b599-4927-bd9b-6b33b4abec45',_binary '','2024-09-19 16:01:53.985000','2024-10-16 11:28:15.816000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Nước đóng bình 20L cũng là giải pháp tiết kiệm, kinh tế và thân thiện với môi trường.\n',26000,'Lavie Water tự hào mang đến sản phẩm nước bình 20L có chất lượng vượt trội, giúp cơ thể bạn luôn cân bằng và khỏe mạnh.\n',NULL,'Nước uống Tinh Khiết Bidrico (19 lít) có vòi',20000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,2,-1,1,NULL,NULL,''),('d803cd82-adce-4065-8873-ff2543a7b4f1',_binary '','2024-09-19 16:01:53.920000','2024-10-21 08:45:08.877000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Đội giao nhận nhiều năm kinh nghiệm, thông thuộc địa điểm các công trình, tòa nhà, các con hẻm các quận trung tâm Sài Gòn.',23000,'Đội giao nhận nhiều năm kinh nghiệm, thông thuộc địa điểm các công trình, tòa nhà, các con hẻm các quận trung tâm Sài Gòn. Đảm bảo giao hàng đúng hẹn cho các đơn vị làm sự kiện, tổ chức hội họp, tour du lịch đi gấp trong ngày,…\n\nĐịa điểm giao hàng: Quận 1, Quận 3, Quận 4, Quận 5, Quận 7, Quận 8, Quận 10',NULL,'Nước uống lavie Tinh Khiết  (19 lít) có vòi',20000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,1,-4,3,NULL,NULL,''),('e3827b59-224c-432e-82e5-95cd732606ba',_binary '','2024-10-12 01:28:24.558000','2024-10-12 01:28:24.587000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/17ad2773-56d4-404d-8669-cdac9ddb399d.jpg?alt=media','<p>23221321</p>',26000,'<p>65456654</p>','http://localhost:8080/quan-tri/them-san-pham','sản phẩm mới',25000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,8,7,0,_binary '\0',4,''),('ea634264-e012-43dc-9736-059a42ad04f5',_binary '','2024-09-19 16:01:54.000000','2024-09-19 16:01:54.000000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Hãy để Lavie Water chăm sóc gia đình bạn bằng sản phẩm nước khoáng tinh khiết, an toàn và chất lượng cao.',22000,'Nước Satori 20L được sản xuất dựa trên công nghệ hoàn lưu khoáng sRO tiên tiến. Khác biệt so với các công nghệ lọc nước thông thường, công nghệ sRO giữ lại những khoáng chất tự nhiên có lợi trong nước.',NULL,'Nước uống Tinh Khiết Ion Life (19 lít) có vòi',20000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,3,0,0,NULL,NULL,''),('fc5e171f-3b24-4399-bab8-13c451e5d8d0',_binary '','2024-09-19 16:01:54.025000','2024-09-19 16:01:54.025000','https://firebasestorage.googleapis.com/v0/b/gaonuocthienan-5b6c1.appspot.com/o/70b186d1-d480-4c65-9246-b1d40796faab.webp?alt=media','Đặt bình nước Satori 20L nơi khô ráo, thoáng mát, sạch sẽ. Tránh ánh sáng trực tiếp, mùi mạnh hoặc các loại hoá chất.\n',23000,'Nên dùng trong vòng 2 tuần kể từ ngày mở niêm phong vòi hoặc nắp để đảm bảo sản phẩm luôn ở trạng thái chất lượng tốt nhất. Đặt bình nước Satori 20L nơi khô ráo, thoáng mát, sạch sẽ. Tránh ánh sáng trực tiếp, mùi mạnh hoặc các loại hoá chất.\n',NULL,'Nước uống Tinh Khiết satori (19 lít) có vòi',20000,100,'cfb70096-68ab-49cd-b389-0ffefdfd3eac',1,4,0,0,NULL,NULL,'');
